We have a Tooltip component that is used in different parts of the application. The Tooltip component is a child of a parent component that is not related to the other parent components.

The problem is that when we open a Tooltip, it stays open even if we open another Tooltip.

## The Solution

To solve this problem, we can use React Context to create a global state for the Tooltip component. This global state will allow us to keep track of the currently open Tooltip and close it when we open another Tooltip.

Here's how we can implement this solution:

1. Create a new file called `TooltipContext.js` in the `context` folder.

```javascript
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  const openTooltipHandler = (id) => {
    if (openTooltip === id) {
      closeTooltip();
    } else {
      setOpenTooltip(id);
      closeTooltip();
    }
  };

  return (
    <TooltipContext.Provider value={{ openTooltipHandler, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

In this file, we create a new context called `TooltipContext` and a provider component called `TooltipProvider`. The provider component has a state called `openTooltip` that keeps track of the currently open Tooltip. We also have two functions called `closeTooltip` and `openTooltipHandler`. The `closeTooltip` function sets the `openTooltip` state to `null`, and the `openTooltipHandler` function sets the `openTooltip` state to the `id` of the Tooltip that we want to open.

2. Wrap the parent components of the Tooltip component with the `TooltipProvider` component.

```javascript
import { TooltipProvider } from '../context/TooltipContext';

function ParentComponent() {
  return (
    <TooltipProvider>
      <ChildComponent />
    </TooltipProvider>
  );
}

function ChildComponent() {
  return (
    <div>
      <Tooltip id="tooltip1">Hello World</Tooltip>
      <Tooltip id="tooltip2">Goodbye World</Tooltip>
    </div>
  );
}
```

In this example, we wrap the `ParentComponent` with the `TooltipProvider` component. This will allow the `ChildComponent` to access the `TooltipContext` and use the `openTooltipHandler` and `closeTooltip` functions.

3. Modify the Tooltip component to use the `TooltipContext`.

```javascript
import { useContext } from 'react';
import { TooltipContext } from '../context/TooltipContext';

function Tooltip({ id, children }) {
  const { openTooltipHandler, closeTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    openTooltipHandler(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {openTooltip === id && <div className="tooltip">{id}</div>}
    </div>
  );
}

export default Tooltip;
```

In this modified Tooltip component, we use the `useContext` hook to access the `TooltipContext`. We also add two event handlers called `handleMouseEnter` and `handleMouseLeave`. The `handleMouseEnter` function calls the `openTooltipHandler` function with the `id` of the Tooltip, and the `handleMouseLeave` function calls the `closeTooltip` function.

