To create a Chrome extension that takes screenshots of the current tab and saves them to the desktop, follow these steps:

1. Create a new folder for your extension and create the following files inside it:

- `manifest.json`
- `background.js`
- `popup.html`
- `popup.css`
- `content.js`

2. Edit `manifest.json` and add the following content:

```json
{
  "manifest_version": 2,
  "name": "Screenshotter",
  "version": "1.0",
  "description": "Take screenshots of the current tab and save them to the desktop",
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  },
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "permissions": [
    "activeTab",
    "<all_urls>",
    "downloads"
  ]
}
```

Replace `icon.png` with the path to your desired icon file.

3. Edit `background.js` and add the following content:

```javascript
chrome.browserAction.onClicked.addListener((tab) => {
  chrome.tabs.captureVisibleTab((screenshotUrl) => {
    const viewTabUrl = chrome.extension.getURL("popup.html?tabId=" + tab.id);
    chrome.tabs.create({ url: viewTabUrl }, (createdTab) => {
      chrome.tabs.onUpdated.addListener((tabId, changeInfo, tab) => {
        if (changeInfo.status === "complete" && tabId === createdTab.id) {
          chrome.tabs.sendMessage(tabId, { screenshotUrl });
        }
      });
    });
  });
});
```

4. Edit `popup.html` and add the following content:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Screenshotter</title>
  <link rel="stylesheet" href="popup.css">
</head>
<body>
  <button id="save-screenshot">Save Screenshot</button>
  <script src="popup.js"></script>
</body>
</html>
```

