function pack(entities) {
  const buf = new ArrayBuffer(entities.length * 1);
  const view = new DataView(buf);
  entities.forEach((entity, i) => {
    view.setUint8(i, (entity.id << 3) | entity.size);
  });
  return buf;
}

function unpack(buf) {
  const view = new DataView(buf);
  const entities = [];
  for (let i = 0; i < view.byteLength; i++) {
    const entity = {
      id: view.getUint8(i) >> 3,
      size: view.getUint8(i) & 0x07
    };
    entities.push(entity);
  }
  return entities;
}
```
In the `pack` function, we first create a new ArrayBuffer with a size of `entities.length * 1` bytes, since each entity takes up 1 byte of space. We then create a new DataView for the ArrayBuffer, which allows us to read and write different data types at specific byte offsets.

We then use the `forEach` method to iterate over each entity in the `entities` array. For each entity, we use the `setUint8` method of the DataView to write the packed value of the entity to the ArrayBuffer. The packed value is calculated by shifting the `id` value 3 bits to the left and then OR-ing it with the `size` value.

