For each byte, we create a new entity object with the `id` and `size` properties. The `id` property is calculated by shifting the byte value 3 bits to the right, which extracts the upper 4 bits. The `size` property is calculated by performing a bitwise AND operation with 0x07, which extracts the lower 3 bits.

